#include <iostream>
#include <vector>
#include <unordered_map>
using namespace std;

class Solution {
public:
    long long zeroFilledSubarray(vector<int>& nums) {
        long long sum = 0;
        long long left = -1, right = -1;
        for (int i = 0; i < nums.size(); i++) {
            if (nums[i] == 0 ){
                if (left == -1) {
                    left = i;
                    right = i;
                }else {
                    right = i;
                }
            }else if (left != -1) {
                long long len = right - left + 1;
                sum += len * (len + 1) / 2;
                left = -1;
                right = -1;
            }
        }
        if (left != -1) {
            long long len = right - left + 1;
            sum += len * (len + 1) / 2;
        }
        return sum;
    }
};


